const token = localStorage.getItem('token')

const AdminDashboard = () => {
    const result = axios.get('https://secopsapi.herokuapp.com/api/users', {headers: {authorization: `Bearer ${token}`}}).then((res) => {
        return res.data.message
    })
    
    Promise.resolve(result).then((res) => {
        
    })
    
    
    return (
        <div className="py-3">
            <Container>
                <h1 className="text-center">Club Mem</h1>
              
            </Container>
        </div>
        
    )

    
}

export default AdminDashboard
